function App() {
  return (
    <header className="header">
      <div className="logo">
        <img
          src="v1/img/logo.png"
          alt="heart logo"
          width="120px"
          height="120px"
        />
        <h1>Praise</h1>
      </div>

      <button className="head-btn btn-large">Share</button>
    </header>
  );
}

export default App;
